import React, { useState } from 'react';
import Header from './Header';
import Footer from './Footer';
import CreateNote from './CreateNote';
import Note from './Note';


const App = () => {
const [addItem, setAddItem] = useState();
  const addNote = (note) => {
    //alert('I am clicked');
    setAddItem((preData) => {
      return [...preData, note];
    });
  };
  return(
    <>
    <Header />
    <CreateNote passNote = {addNote} />
    <Note />

    addItem.m

    <Footer />
    </>
  );
};

export default App;
